import React from 'react'
import { categories } from '../data';

export default function CategoryItem({name, icon, vacant}) {
  return (
    <div c="col-lg-3 col-sm-6 wow fadeInUp" data-wow-delay="0.1s">
      <a c="cat-item rounded p-4" href="">
        {icon}
        <h6 c="mb-3">{name}</h6>
        <p c="mb-0">{vacant} Vacancy</p>
      </a>
    </div>
  );
}
